import React from 'react'
import NavbarLoggedIn from './NavbarLoggedIn'
import NavbarLoggedOut from './NavbarLoggedOut'
import { useAuth } from '../Hooks/useAuthLogin'

const Navbar = () => {

  const {auth} = useAuth();

  if (!auth){
    return (
      <NavbarLoggedIn/>
    );
  }
  else{
    return (
      <NavbarLoggedOut/>
    )
  }
}

export default Navbar
